exports.handler = async function(event, context) {
  if (!verifier(event)) {
    return {
      statusCode: 401,
    }
  }
  // console.log(event)
  const { type, guild_id, data } = JSON.parse(event.body)
  if (type === InteractionType.PING) {
    return {
      statusCode: 200,
      body: JSON.stringify({ type: InteractionResponseType.PONG }),
    }
  }
  if (type === InteractionType.APPLICATION_COMMAND) {
    const { name, options } = data
    if (name === "test_community") {
      console.log("test command received!")
      return respond("bot is working!")
    } else if (name === "setup_nfl_polls") {
      const channel = options[0].value
      const auto = options[1] ? options[1].value : false
      await setDoc(
        doc(db, "polls", guild_id),
        {
          nfl: {
            channel: channel,
          },
        },
        { merge: true }
      )
      const guilds = {}
      guilds[guild_id] = auto
      await setDoc(
        doc(db, "polls", "guild_updates"),
        {
          nfl: {
            guilds,
          },
        },
        { merge: true }
      )
      const res = await DiscordRequest(`/guilds/${guild_id}/emojis`, {
        method: "GET",
      })
      const emojisData = {}
      const currentEmoji = await res.json()
      currentEmoji.forEach(e => {
        const name = e.name
        const id = e.id
        emojisData[name] = id
      })
      const currentEmojiNames = currentEmoji.map(e => e.name)
      const teams = Object.keys(nfl_emojis).filter(
        t => !currentEmojiNames.includes(`snallabot_${t}`)
      )
      if (teams.length === 0) {
        await setDoc(
          doc(db, "polls", guild_id),
          {
            nfl: {
              emojis: emojisData,
            },
          },
          { merge: true }
        )
        return respond("all emojis are already setup, channel is configured!")
      }
      const emojiPromises = teams.map(t => {
        return DiscordRequest(`guilds/${guild_id}/emojis`, {
          method: "POST",
          body: {
            name: `snallabot_${t}`,
            image: nfl_emojis[t],
          },
        })
      })
      const responses = await Promise.all(emojiPromises)
      const emojiRes = await Promise.all(responses.map(r => r.json()))
      emojiRes.forEach(e => {
        const name = e.name
        const id = e.id
        emojisData[name] = id
      })
      await setDoc(
        doc(db, "polls", guild_id),
        {
          nfl: {
            emojis: emojisData,
          },
        },
        { merge: true }
      )
      if (responses.every(r => r.ok)) {
        return respond("setup all my emojis and configured channel!")
      } else {
        return respond("something went wrong... not all emojis were setup")
      }
    } else if (name === "manual_update") {
      const docRef = doc(db, "polls", guild_id)
      const docSnap = await getDoc(docRef)
      if (!docSnap.exists()) {
        return respond(
          `no community found for ${guild_id}, do /setup_nfl_polls first`
        )
      }
      const polls = docSnap.data()
      // fail this early
      try {
        const channel = polls.nfl.channel
      } catch (error) {
        return respond("missing configuration, run `/setup_nfl_polls` first")
      }

      const res = await fetch(
        "https://nallapareddy.com/.netlify/functions/community-background",
        {
          method: "POST",
          body: JSON.stringify({
            guild_id: guild_id,
          }),
        }
      )
      if (res.ok) {
        return respond("creating polls shortly!")
      } else {
        console.log(res)
        return respond(
          "something went wrong :( I am not sure if polls will be created maybe ask owner"
        )
      }
    }
  }
  return respond(
    "we should not have gotten here... this command is broken contact owner"
  )
}
